ads.description:
Sprzedam Audi A4B5 w Bardzo-Dobrym Stanie jak na swój wiek, z silnikiem 1.6 z 1996 roku, wyposażony w instalację LPG ważna jeszcze 6 lat. Przegląd do października 2025r. O.C. do końca grudnia 2025r.

Auto mocno doinwestowane i gotowe do dalszej jazdy. 

Z ważniejszych rzeczy to:



-Nowy olej w silniku firmy Total 5W40 ok.1000km temu;

-Nowy olej w skrzyni biegów 75W90 ok. 100-200km temu;

-Nowy filtr powietrza;

-Nowy filtr oleju;

-Rozrząd jeszcze na 44 tys. kilometrów;

-Nowy uszczelka pokrywy zaworów;

-Wyczyszczony cały układ dolotowy wraz z przepustnicą i silniczkiem krokowym;

-Zredukowane luzy na łożyskach piast w tylnych kołach;

-Regeneracja i czyszczenie tylnych zacisków hamulcowych i klocków (jakiś amator tuningu malował na czerwono a później na żółto zaciski wraz z klockami i przewodami i wszstko się posklejało);

-Nowe zaciski hamulcowe przód wraż z klockami;

-Po przeglądzie i regulacji gazu.



Auto dostało koła stalowe 16" z oponami lato 205/55 R16, dwie opony Continental a dwie z rantami anty dobiciowymi Hankook.

Felgi poddane renowacji, oczyszczone z rdzy i nierówności na ile było to możliwe i pomalowane na czarny mat z nietypowym ET 33 jak dla Audi. Dzięki temu auto stoi szerzej na osiach ( prawie do obrysu auta) dzięki temu lepiej się prowadzi w zakrętach, nie buja jak na innych kołach z ET 40-55, nie przechyla się na boki tak bardzo jak na standardowych kołach. Z tyłu dodatkowo dystanse 6mm co daje ET 27.

Grill został pomalowany także na czarny mat.



Auto ma już prawie 30 lat, więc proszę nie oczekiwać ideału bo do ideału trzeba by dołożyć z jedno lub dwa zera do ceny. To nie jest auto z salonu a jiż swoje lata ale trzyma się bardzo dobrze.



Buda, podłoga i progi zdrowe, normalnie podnosi się na lewarku i podnośniku bez dziwnych dźwięków i trzasków. Karoseria ma jakieś rysy i otarcia od życia miejskiego i braku szacunku ze strony innych parkujących ale tragedii nie ma, jak na prawie 30 latka jest w stanie znakomitym ( opinia moja i mechaników, znajomych ). 



Nie ma rdzy, zgnilizny, dziur i purchli jak inne auta i jest dobrą bazą na klasyka po dopiciwoniu i dopracowaniu szczegułów.



Z uwag:

-czasem dzwoni tłumik środkowy wydechu;

-czasem puknie w prawym przednim amortyzatorze ale to tylko przy wpadaniu w dołek lub gwałtownym zjeżdżaniu z uskoku ( podobno jakieś elementy amortyzatora wewnątrz ), amortyzatory sprawne, trzymają tłumienie.



Ogólnie:



Jak za tak niską kwotę mamy auto z przeglądem do października i O.C. do końca roku. Po wymianie płynów, filtrów i sprawnym rozrządem, silnik zdrowy, nadal jeździ na 5W40 a nie jak inne na 10W czy 15W. Nie ma wycieków i nie bierze oleju, bez rdzy i z dobrą bazą na klasyka lub dalszą jazdę codzienną. Doinwestowany w najważniejsze podzespoły i płyny eksploatacyjne. Nie zgniły i bez rdzy. Dokładam alufelgi 15" firmy Borbet z tego auta z oponami zimowymi 195/65 R15 na dojechanie raczej bo już stare.

Zawieszenie, układ hamulcowy wraz z ręcznym i uklad kierowniczy sprawne.

Sprzęgło wysoko jak podobno w każdym audi ( opinia kilku mechaników ), nie ślizga się i działa jak trzeba, podobno tak ma być ( opinia mechaników ).

Biegi działają prawidłowo.

Itd... długo by pisać...



Z Wyposażenia:



-Elektryczny szyberdach;

-Elektryczne lusterka;

-Elektryczne szyby przód;

-Radio USB Pioneer;

-Kilka głośników w drzwiach;

-Przyciemniane szyby tył;

-Poduszka powietrzna kierowcy i pasażera;

-Wspomaganie kierownicy;

-Regulowana kierownica (góra/dół, przód/tył);

-Immobilaizer;

-Grzana tylna szyba;

-Regulacja wysokości świateł drogowych;

-Oświetlenie wnętrza i bagażnika;

-Blokada drzwi od wewnątrz (w przycisku);

-Centralny zamek z kluczyka;

-Lewarek i klucz oryginalny w bagażniku;

-Instalacja LPG.

-Schowki;

-Popielniczka/Zapalniczka;

-Uchwyty na kubki/butelki.



Długo by pisać, najlepiej samemu obejrzeć w Miejscowości Puławy, woj. Lubelskie po wcześniejszym kontakcie telefonicznym.



Maruderom z góry dziękuję, nie interesuje ten egzemplarz lub cena szukaj złomu za 3.000zl do dalszych inwestycji i napraw. ( Szanujmy swój czas ).



Auto ma prawie 30 lat więc do ewentualnych poprawek czy to lakierniczych, blacharskich czy mechanicznych wedle uznania, bo każdy oczekuje czego innego od auta.

Ja zrobiłem co mogłem i na ile było mnie stać aby było sprawne i cieszyło oko. Reszta w rękach kolejnego właściciela. 

Coś do poprawy się znajdzie napewno.

Szuka nowego Właściciela !!!



Kia Rio z 2010 r. (ostatni rok drugiej wersji) z maksymalnym jak na tamte czasy wyposażeniem.

Pierwsza rejestracja: styczeń 2011.

Mamy zatem:

-  sprawną klimatyzację, a w sumie to półklimatronik;

-  instalację LPG (butla w kole ważna do 2028, wlew pod klapką)

-  cały zestaw poduszek powietrznych;

-  kontrolę trakcji;

-  ABS;

-  radioodtwarzacz  z odczytem PM3; 

-  złącze USB i AUX;

-  kierownicę z obsługą radia i z pokrowcem;

-  pełną elektrykę sterowania szyb i lusterek;

-  kierunki w lusterkach;

-  halogeny, uchwyt na telefon;

-  drugi zestaw felg stalowych z zimówkami Pirelli Cinturato 15" w super stanie + 4 oryginalne kołpaki;

-  przegląd techniczny - czerwiec 2026, OC - październik 2025;

-  klucze 2 szt.



Jestem właścicielem Kijanki od 4 lat i od przebiegu 120 tys. km, a zatem wiem sporo na jego temat. Za moich czasów auto nie uczestniczyło w żadnym, poważnym incydencie, choć zdarzyło się zatrzymanie na haku auta poprzedzającego, co zostawiło skazę na zderzaku i honorze.

Na kołach są letnie Continentale w bardzo dobrym stanie, a alufelgi też prezentują się całkiem niegłupio. 

Samochód na bieżąco serwisowany, nie wymaga interwencji. Z tego co zauważyłem, zaczęła "podciekać" osłona na lewym, przednim przegubie. Auto nie plami, jest szczelne.

Proszę też pamiętać, że auto ma 15 lat, jest trochę rysek, odprysków od kamyków się znajdzie, a na tylnych nadkolach pojawiły się początki "rudej". Wnętrze auta prezentuje się rewelacyjnie jak na swój wiek i przebieg.

Jestem przekonany, że zarówno cena jak i wyposażenie mocno zrekompensują wspomniane niedogodności. 

Zapraszam do obejrzenia, na testy i ewentualnego zakupu. 

Jeśli komuś nie przypadnie do gustu Kijanka, to może spodoba mu się o 2 lata młodszy Peugeot 206 plus, który jest wystawiony na innym ogłoszeniu. Ma silnik 1.4 B i również nadaje się pod LPG.



Zapraszam do Leopoldowa k/Ryk (lubelskie, obok trasy S17).
